exports.hotspot = function (req, res) {
            
            if(!req.body.actualSystems.length){
                respond(res,JSON.stringify({historic_id:1,hotspots:[]}));
                return;
            }
            var shasum = crypto.createHash('sha1');
            shasum.update(JSON.stringify(req.body));
            var h=hotspots();
            h.hotspots.sort(function(b,a){return((a.pulse-b.pulse)/Math.abs(a.pulse-b.pulse))});
            h.historic_id=shasum.digest('hex');
            respond(res, JSON.stringify(h));
            
        };

